import React, { useState } from 'react';

function Login({ setUserInfo }) {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin1 = (e) => {
    console.log("handleLogin1 function called");
    console.log("setUserInfo is a function:", typeof setUserInfo); // Check if setUserInfo is a function
    console.log("username:", username, "password:", password); // Check if username and password are set correctly
    e.preventDefault();
    try {
      console.log("Im here")
      if (username === "admin" && password === "adminPassword") {
          setUserInfo({ userName: username, userPassword: password, userType:"admin" });
          window.location.href = '/admin';
      }
      if (username === 'manager' && password === 'managerPassword') {
        setUserInfo({ userName: username, userPassword: password, userType:"manager" });
        window.location.href = '/manager';
      }
      if (username === 'analyst' && password === 'analystPassword') {
        setUserInfo({ userName: username, userPassword: password, userType:"analyst" });
        // window.location.href = '';
      }
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="login-container">
      <h2>Login</h2>
      <form onSubmit={handleLogin1}>
        <div className="form-group">
          <label>Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <button type="submit" onClick={() => console.log("Submit button clicked")}>Login</button>
      </form>
    </div>
  );
}

export default Login;
